import React from "react";

function HelloDiv() {
  return <div>
    <h1>Hello! My name is Alex</h1>
    <h3>Thing I like</h3>
    <ul>
      <li>Netflix</li>
      <li>Sleeping</li>
      <li>Coding</li>
    </ul>
  </div>

}

export default HelloDiv;
